import React from "react";

const Home = () => {
  return (
    <div className="home">
      <h1>Mohammad Kharma</h1>
      <div className="image"></div>
      <h3>Welcome to my Portfolio!</h3>
      <p>Take a look around and feel free to contact me</p>
    </div>
  );
};

export default Home;
